import React from 'react'
import { FiHelpCircle, FiSettings, FiUser } from 'react-icons/fi'
import { IconType } from 'react-icons'

interface Action {
    Icon: IconType      // <-- aquí
    label: string
    onClick: () => void
  }

  const actions: Action[] = [
    { Icon: FiHelpCircle, label: 'Ayuda',    onClick: () => console.log('Help')     },
    { Icon: FiSettings,   label: 'Ajustes',  onClick: () => console.log('Settings') },
    { Icon: FiUser,       label: 'Perfil',   onClick: () => console.log('Profile')  },
  ]


const Header: React.FC = () => {
  return (
    <header className="bg-gradient-to-b from-primary-blue to-secondary-blue px-6 py-4 flex justify-between items-center">

      {/* ─── LOGO + NOMBRE ───────────────────────────────────────────────── */}
      <div className="flex items-center">
        {/* Ajusta el src y el tamaño según tu exportación de Canva */}
        <img
          src="/logo-autowhapp.svg"
          alt="AutoWhapp Logo"
          className="w-10 h-10 mr-3"
        />
        <h1 className="text-white text-2xl font-semibold font-poppins">
          AutoWhapp
        </h1>
      </div>

      {/* ─── BOTONES DE ACCIÓN ────────────────────────────────────────────── */}
      <div className="bg-secondary-blue rounded-xl p-2 flex space-x-3 shadow-md">
  {actions.map(({ Icon, label, onClick }) => (
    <button
      key={label}
      onClick={onClick}
      aria-label={label}
      className="
        bg-primary-blue text-white p-2 rounded-full
        hover:bg-blue-600 hover:scale-110
        transition-transform duration-200 ease-out
        shadow-sm
      "
    >
      {/* Ahora TS sabe que Icon es un componente válido */}
      <Icon size={30} />
    </button>
  ))}
</div>
    </header>
  )
}

export default Header
